import React from "react";
import search_icon from "../search_icon.png";
import '../App.css';
import { Link } from "react-router-dom";
import Libros from "./Libros";

console.log(search_icon);

function SearchBar(){
    return (
        <nav class="navbar navbar-expand-sm  bg-white">
        
        <div class="container-fluid">
            
          <div class="collapse navbar-collapse" id="mynavbar">
            <ul class="navbar-nav me-auto">
              <li class="nav-item">
                <a class="nav-link" href="/"></a>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to="/Libros"></Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to="/Reservas">Libros reservados</Link>
              </li>
            </ul>
            <form class="d-flex">
              <input class="form-control me-2" type="text" placeholder="Busca"/>
              <button class="btn" type="button"><img src={search_icon} width='20' alt= 'search_icons'/></button>
            </form>
          </div>
        </div>
      </nav> 
    );
}

export default SearchBar
